const Navbar = () => {
    return(
        <div>
            <nav className='navbar'>
                <div className='logo'><img src="/assets/pokemon_logo.png" alt="logo" width="500" height="600"></img></div>
            </nav>   
        </div>
    );
};

export default Navbar;
